CREATE DATABASE  IF NOT EXISTS `all_tasks1` 
USE `all_tasks1`;

DROP TABLE IF EXISTS `login`;

CREATE TABLE `login` (
  `uid` int NOT NULL AUTO_INCREMENT,
  `username` varchar(45) DEFAULT NULL,
  `password` varchar(45) DEFAULT NULL,
  `salt` varchar(45) DEFAULT NULL,
  `activation_token` varchar(45) DEFAULT NULL,
  `activated` tinyint DEFAULT NULL,
  `email` varchar(45) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`uid`)
)


DROP TABLE IF EXISTS `task11_city`;

CREATE TABLE `task11_city` (
  `cid` int NOT NULL,
  `city` varchar(45) NOT NULL,
  PRIMARY KEY (`cid`,`city`)
)


DROP TABLE IF EXISTS `task11_state`;

CREATE TABLE `task11_state` (
  `sid` int NOT NULL AUTO_INCREMENT,
  `state` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`sid`)
)


DROP TABLE IF EXISTS `task12_basic_details`;

CREATE TABLE `task12_basic_details` (
  `eid` int NOT NULL AUTO_INCREMENT,
  `fname` varchar(45) DEFAULT NULL,
  `lname` varchar(45) DEFAULT NULL,
  `add1` varchar(45) DEFAULT NULL,
  `add2` varchar(45) DEFAULT NULL,
  `city` varchar(45) DEFAULT NULL,
  `state` varchar(45) DEFAULT NULL,
  `zipcode` bigint DEFAULT NULL,
  `phone` bigint DEFAULT NULL,
  `designation` varchar(45) DEFAULT NULL,
  `gender` varchar(45) DEFAULT NULL,
  `relationshipstatus` varchar(45) DEFAULT NULL,
  `dob` date DEFAULT NULL,
  `email` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`eid`)
) 


DROP TABLE IF EXISTS `task12_education`;

CREATE TABLE `task12_education` (
  `educid` int NOT NULL AUTO_INCREMENT,
  `eid` int DEFAULT NULL,
  `coursename` varchar(45) DEFAULT NULL,
  `passingyear` int DEFAULT NULL,
  `percentage` float DEFAULT NULL,
  PRIMARY KEY (`educid`)
) 


DROP TABLE IF EXISTS `task12_experience`;

CREATE TABLE `task12_experience` (
  `expid` int NOT NULL AUTO_INCREMENT,
  `eid` int DEFAULT NULL,
  `compnayname` varchar(45) DEFAULT NULL,
  `designation` varchar(45) DEFAULT NULL,
  `start` date DEFAULT NULL,
  `end` date DEFAULT NULL,
  PRIMARY KEY (`expid`)
)

DROP TABLE IF EXISTS `task12_language`;

CREATE TABLE `task12_language` (
  `id` int NOT NULL AUTO_INCREMENT,
  `eid` int DEFAULT NULL,
  `languagename` varchar(45) DEFAULT NULL,
  `type` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`id`)
)



DROP TABLE IF EXISTS `task12_preference`;

CREATE TABLE `task12_preference` (
  `pid` int NOT NULL AUTO_INCREMENT,
  `eid` int DEFAULT NULL,
  `location` varchar(45) DEFAULT NULL,
  `noticeperiod` int DEFAULT NULL,
  `expectedCTC` bigint DEFAULT NULL,
  `currentCTC` bigint DEFAULT NULL,
  `department` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`pid`)
)

DROP TABLE IF EXISTS `task12_reference`;

CREATE TABLE `task12_reference` (
  `refid` int NOT NULL AUTO_INCREMENT,
  `eid` int DEFAULT NULL,
  `name` varchar(45) DEFAULT NULL,
  `contact` bigint DEFAULT NULL,
  `relation` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`refid`)
) 


DROP TABLE IF EXISTS `task12_technology`;

CREATE TABLE `task12_technology` (
  `tid` int NOT NULL AUTO_INCREMENT,
  `eid` int DEFAULT NULL,
  `technology` varchar(45) DEFAULT NULL,
  `type` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`tid`)
)

DROP TABLE IF EXISTS `task5_studentmaster`;

CREATE TABLE `task5_studentmaster` (
  `sid` int NOT NULL DEFAULT '0',
  `fname` varchar(45) DEFAULT NULL,
  `lname` varchar(45) DEFAULT NULL,
  `created` timestamp(4) NULL DEFAULT CURRENT_TIMESTAMP(4) ON UPDATE CURRENT_TIMESTAMP(4),
  `city` varchar(45) DEFAULT NULL,
  `state` varchar(45) DEFAULT NULL,
  `phone` bigint DEFAULT NULL,
  `collage` varchar(45) DEFAULT NULL,
  `email` varchar(45) DEFAULT NULL,
  `pincode` int DEFAULT NULL
)

DROP TABLE IF EXISTS `task6_attendence`;

CREATE TABLE `task6_attendence` (
  `aid` int NOT NULL,
  `date` date NOT NULL,
  `attendence` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`aid`,`date`)
) 

DROP TABLE IF EXISTS `task6_exam`;

CREATE TABLE `task6_exam` (
  `sr` int NOT NULL AUTO_INCREMENT,
  `sid` int DEFAULT NULL,
  `subid` int DEFAULT NULL,
  `type` int DEFAULT NULL,
  `theory` int DEFAULT NULL,
  `prac` int DEFAULT NULL,
  PRIMARY KEY (`sr`)
) 


DROP TABLE IF EXISTS `task6_studentmaster`;

CREATE TABLE `task6_studentmaster` (
  `sid` int NOT NULL DEFAULT '0',
  `fname` varchar(45) DEFAULT NULL,
  `lname` varchar(45) DEFAULT NULL,
  `created` timestamp(4) NULL DEFAULT CURRENT_TIMESTAMP(4) ON UPDATE CURRENT_TIMESTAMP(4),
  `city` varchar(45) DEFAULT NULL,
  `state` varchar(45) DEFAULT NULL,
  `phone` bigint DEFAULT NULL,
  `collage` varchar(45) DEFAULT NULL,
  `email` varchar(45) DEFAULT NULL,
  `pincode` int DEFAULT NULL,
  PRIMARY KEY (`sid`)
)



DROP TABLE IF EXISTS `task9_option_master`;

CREATE TABLE `task9_option_master` (
  `oid` int NOT NULL AUTO_INCREMENT,
  `sid` int DEFAULT NULL,
  `option_key` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`oid`),
  KEY `fk_task9_option_master_1_idx` (`sid`),
  CONSTRAINT `fk_task9_option_master_1` FOREIGN KEY (`sid`) REFERENCES `task9_select_master` (`sid`)
)



DROP TABLE IF EXISTS `task9_select_master`;

CREATE TABLE `task9_select_master` (
  `sid` int NOT NULL,
  `select_name` varchar(45) DEFAULT NULL,
  `select_key` varchar(45) DEFAULT NULL,
  `combo_type` varchar(45) DEFAULT NULL,
  `multi_value` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`sid`)
) 


